import React from 'react';
import { Box, Grid, FormGroup, FormControl, InputLabel, OutlinedInput, FormHelperText, makeStyles } from '@material-ui/core';
import { SectionHeading } from '../Component';
import './Css/Contact.scss';

const useStyles = makeStyles(theme => ({
    margin: { margin: "0 auto" }
}))

const ContactForm = () => {
    const classes = useStyles();
    return (
        <>
            <section>
                <Box className="contactSec my-5">
                    <Grid container>
                        <Grid item lg={6} md={8} xs={10} className={classes.margin}>
                            <Box>
                                <SectionHeading head="Contact Us" />
                                <Box className="border border-danger">
                                    <form>
                                        <FormGroup>
                                            <FormControl fullWidth className={classes.margin} variant="outlined">
                                                <InputLabel htmlFor="outlined-adornment-amount">Amount</InputLabel>
                                                <OutlinedInput
                                                    id="outlined-adornment-amount"
                                                    labelWidth={60}
                                                />
                                            </FormControl>
                                        </FormGroup>
                                    </form>
                                </Box>
                            </Box>
                        </Grid>
                    </Grid>
                </Box>
            </section>
        </>
    )
}

export default ContactForm;
